import React,{Component} from 'react';
import {Row, Column} from 'simple-flexbox';
import { StyleSheet, css } from 'aphrodite';
import Card from './Cards/Dashboard/Cards';
import SaasCard from './Cards/Sophosaas/SaasCard';
import Login from '../Login/Login/Login';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";


function Content(props){
    const {pathname, isSignedin } = props;
    console.log(pathname)
    let pathdets = pathname
    if (pathdets == 'Login'){
        return (
            <Login isSignedin={isSignedin}/>
        )
   }
    else if (pathdets == 'Sophos as a Service'){
        return(
            <SaasCard/>
        )
   } else  if (pathdets =='Dashboard') {
    return (
        <Card/>
    )
} else{
       return(
           <h1>Nothing going on here</h1>
       )
   }
}

export default Content;
